The '''Choke devil''' is a [[superior]] variant of the normal [[dust devil]]. It has a chance of spawning once after purchasing the unlock ''Bigger and Badder'' for 150 [[Slayer reward point]]s from any [[Slayer master]].

Similar to their lower-level counterparts, a [[facemask]] or [[slayer helmet]] is required to safely engage them, as otherwise the player will take rapid damage and have their stats drained.

